(16, 4, 'Infinix Hot 40i', 1, '⚙️ Performance & Cooling\r\nMediaTek Dimensity 8350 Ultra chip: Offers mid-range yet gaming-focused performance with efficient power usage.\r\n\r\n\r\nAdvanced cooling: Features 3D Vapor Cloud Chamber liquid cooling + smart thermal management; optional MagCharge Cooler accessory further reduces surface temperature.\r\nandroidcentral.com\r\n\r\nUltrasonic gaming triggers: Hardware controls mapped to gameplay for enhanced responsiveness.\r\nandroidcentral.com\r\n\r\n🔋 Battery & Charging\r\nBypass Charging 2.0 and fast wired/wireless support: Enables stable charging during gameplay with less heat buildup.\r\n\r\n5,000 mAh battery: Matches industry standards with optimized software to maintain peak gaming performance.', '', '', '', '', 120, 0, 'Piece', 2, '45rt7', 'Infinix ', 'abc123', '', '', '', NULL, NULL, NULL, '', '', 1, NULL, '2025-06-12 08:28:07', '2025-06-12 09:22:26', 'Buyer'),
(17, 4, 'watch ', 1, '\r\n⌚ Design & Display\r\n1.43″ AMOLED HD screen (466 × 466 px) delivers crisp visuals and vibrant colours \r\nelvisnkencomputers.com\r\n\r\n\r\nClassic round bezel with a stainless‑metal housing (47 × 12.3 mm, 67 g including strap) for a polished yet sporty finish \r\nnext.mn\r\n\r\n📶 Connectivity & Controls\r\nBluetooth calling support and built‑in mic/speaker enable hands‑free voice calls .\r\n\r\nBluetooth 5.3 ensures stable connections, and it supports Bluetooth calls directly.\r\n\r\n💪 Health & Fitness Tracking\r\nComprehensive monitoring: heart rate, SpO₂, sleep, stress, female cycle, breathing exercises \r\nnext.mn\r\n\r\n\r\nSmart Health Check with one-tap diagnostics and over 25 sports modes for tracking various exercises \r\n\r\n\r\n\r\n🧠 AI & Smart Features\r\nPersonal AI assistant on your wrist to set reminders, check weather, control music, etc. \r\n\r\n\r\nOffers 200+ watch faces and an optional Always-On Display (AOD) mode for quick glance convenience .\r\n\r\n🔋 Battery & Durability\r\nUp to 12 days battery life, with wireless charging support and quick 3-hour top-ups \r\nwap.activity.infinixmobility.com\r\n\r\nIP68 water/dust resistance, rated for up to 1 metre depth—ready for workouts and outdoor use .', '', '', '', '', 2, 0, 'Piece', 3, 'fh68', 'Ronin', 'fht68k', '', '', '', NULL, NULL, NULL, '', '', 1, 1, '2025-06-12 08:29:15', '2025-06-12 09:10:29', 'Buyer'),
(18, 4, 'Think Pad', 1, '🖥️ INBook X1 (Slim / Base)\r\nDisplay & Design: 14″ Full HD IPS panel (~300 nits, 100 % sRGB on Slim), sleek metal build, weighing ~1.48 kg \r\npk.infinixmobility.com\r\n\r\n\r\nProcessor: 10th‑gen Intel Core i3‑1005G1 or i5‑1035G1, paired with Intel UHD Graphics—suitable for everyday tasks and light multitasking \r\ntech.hindustantimes.com\r\n\r\nMemory & Storage: 8 GB RAM, 256–512 GB PCIe SSD; Wi‑Fi 5, Bluetooth 5.1 \r\nmakotekcomputers.com\r\n\r\n\r\nPorts & Features: Good selection—USB‑A (×2 USB 3.0 + 1 USB 2.0), 2× USB‑C (one supports PD fast‑charging & DisplayPort), HDMI, microSD, 3.5 mm audio. Includes backlit keyboard and physical webcam kill‑switch \r\n\r\n\r\nBattery & Charging: 50–55 Wh battery; fast-charges via 65 W USB‑C to ~41% in 30 min, full charge ~90 min; offers ~7–9 hours under typical usage \r\n\r\nUser Feedback: Solid value for casual/home work users. Some reports of hinge and quality issues—community feedback emphasizes careful handling \r\n', '', '', '', '', 56, 0, 'Piece', 2, 'lp205', 'Lenovo', 'GH78IK', '', '', '', NULL, NULL, NULL, '', '', 1, NULL, '2025-06-12 09:18:14', '2025-06-12 09:22:42', 'Buyer'),
(19, 4, 'Luxurious and Adjustable Chair', 1, 'Modern Comfort Chair\r\n\r\nExperience the perfect blend of comfort and style with our Modern Comfort Chair. Crafted with a durable metal frame and high-density foam padding, this chair provides exceptional support for long hours of sitting. The ergonomic design promotes good posture, while the sleek fabric upholstery adds a touch of elegance to any room.\r\n\r\nWhether you\'re furnishing a home office, dining room, or living area, this chair offers versatile use and modern aesthetics. Non-slip feet ensure stability and protect your floors, while the lightweight build makes it easy to move and reposition.', '', '', '', '', 120, 0, 'Piece', 3, '45rt7', 'Crown ', 'abc123', '', '', '', NULL, NULL, NULL, '', '', NULL, NULL, '2025-06-12 10:30:27', '2025-06-16 11:54:57', ''),
(23, 4, 'High-Quality Ceilings Light', 1, ' Ceilings Light', '', '', '', '', 156, 0, 'Piece', 2, '45rt7', ' Ceilings Light', 'hgt567', '', '', '', NULL, NULL, NULL, '', '', NULL, NULL, '2025-06-16 11:58:19', '2025-06-16 11:58:19', ''),
(24, 5, 'Elegant and Durable Bed', 1, ' Durable Bed', '', '', '', '', 200, 0, 'Piece', 1, '45rt7', ' Durable Bed', 'abc123', '', '', '', NULL, NULL, NULL, '', '', NULL, NULL, '2025-06-16 12:17:00', '2025-06-16 12:17:00', '');

